import React from 'react';

import '../style/winLoseDraw.css';
import Score from './Score';

const WinLoseDraw = (props) => {

    let score = 'wld';

    const choiceScore = () => {
        if (props.WinLoseDraw > 1) {
            score = 'win'
        }
    }

    return (
        <div className='wld'>
            <span>{score}</span>
        </div>
    )
}

export default WinLoseDraw;
